import { Link } from "react-router-dom";
const AddBook = ({ handleSearchPage }) => {
	return (
		<Link className="open-search" to="/searchPage">
			<div className="open-search">
				<p>Add a book</p>
			</div>
		</Link>
	);
};

export default AddBook;
